import React from 'react';

export default class CollectionSpotlight extends React.Component {
    render() {
        return (
            <div className="CollectionSpotlight">
                <div className="section featured-collections">
                    {this.props.children}
                    <div className="clearfix"></div>
                </div>
            </div>
        );
    }
}
